import React, { useEffect, useState } from 'react';
import AppCSS from './styles/App.module.css'

function App() {

  /*   const [state, setState] = useState(null);
  
    const callBackendAPI = async () => {
      const response = await fetch('/express_backend');
      const body = await response.json();
  
      if (response.status !== 200) {
        throw Error(body.message)
      }
      return body;
    };
    
    useEffect(() => {
      callBackendAPI()
      .then(res => setState(res.express))
      .catch(err => console.log(err));
    }, []) */

  return (<>
    <header className={AppCSS.header}>
      <div className={AppCSS.logo}>ICF</div>

      <h1>Тест</h1>

      <div className={AppCSS.menu_icon_block}>
        <div className={AppCSS.menu_icon}></div>
      </div>

      <div className={AppCSS.menu}>
        <nav className={AppCSS.menu_block}>
          <div className={AppCSS.logo}>ICF</div>
          <div className={AppCSS.menu_item}>saasc</div>
          <div className={AppCSS.menu_item}>saasc</div>
          <div className={AppCSS.menu_item}>saasc</div>
          <div className={AppCSS.menu_item}>saasc</div>
        </nav>
      </div>
    </header>
    <main>
      <div className={AppCSS.wrapper}>
        <div className={AppCSS.main_item}></div>
        <div className={AppCSS.main_item}></div>
        <div className={AppCSS.main_item}></div>
        <div className={AppCSS.main_item}></div>
        <div className={AppCSS.main_item}></div>
        <div className={AppCSS.main_item}></div>
        <div className={AppCSS.main_item}></div>
        <div className={AppCSS.main_item}></div>
        <div className={AppCSS.main_item}></div>
      </div>
    </main>
    <footer className={AppCSS.footer}>
      <p className={AppCSS.footer_text}>Все права очень даже защищенны. Созданно <a href="https://vk.com/eshe_na_dne">мною</a></p>
    </footer>
  </>);
}

export default App;
